export default function Navbar() {
  return (
    <nav className="flex justify-between items-center px-10 py-6 bg-white shadow-sm fixed w-full z-10 top-0">
      <div className="flex items-center gap-2">
        <img src="/logo192.png" alt="logo" className="w-8 h-8 rounded-full" />
        <h1 className="font-semibold text-gray-800">Arie Pratama</h1>
      </div>
      <ul className="flex gap-8 text-gray-600">
        <li className="hover:text-blue-600 cursor-pointer">About</li>
        <li className="hover:text-blue-600 cursor-pointer">Skills</li>
        <li className="hover:text-blue-600 cursor-pointer">Portfolio</li>
        <li className="hover:text-blue-600 cursor-pointer">Contact</li>
      </ul>
    </nav>
  );
}
